import { BrowserRouter as BrowserRouter,Router, Route, Switch } from 'react-router-dom';

import loginP from './Pages/login';


function App() {
  return (
    <div className="App">
      <BrowserRouter><Router>
      <Route path='/login' component={<loginP/>}/>

        </Router></BrowserRouter>
    </div>
  );
}

export default App;
